const navItems =[
    {
        name: "Generate",
        link: "/generate",
        isSelected: true,
    },
    {
        name: "Explor",
        link: "/explore",
        isSelected: false,
    },
    {
        name: "Forums",
        link: "/forums",
        isSelected: false,
    },
    {
        name: "Pricing",
        link: "/pricing",
        isSelected: false,
    },
]
const userAvatar = [
    {
        id: 0,
        name: "Avi Peltz",
        avatarURL:"https://i.imgur.com/RCwLEoQm.jpg",
        navItems: null,
    }
];

export default function GeneratePage(){
    return(
        <>
            <ProjectNav navItems={navItems}/>
        </>
    );

}
